import React from 'react';
import Filter from "./Filter"

const Filters = (props) => {

return (
    <div>
    <h2>FILTERS</h2>
    <span>
    {props.filters.map((filter) => (
          <>
          <Filter
            label={filter.label}
            field={filter.field}
            values={filter.values}
          />
          </>
        ))}
      </span>
    </div>
)

}

export default Filters;
